import "./App.css";

import Header from "../Header/Header";
import Home from "../Pages/Home/Home";

import products from "../../images/data.json";
import { useState } from "react";

function App() {
  const [products, setProducts] = useState(products);

  return (
    <div className="App">
      <Header />
      <Home />
    </div>
  );
}

export default App;
